function formatPhone(phoneNumber) {
    if(phoneNumber.length == 8)
        return phoneNumber.substring(0, 2) + " " + phoneNumber.substring(2, 5) + " " + phoneNumber.substring(5, 8);

    return phoneNumber;
}

